package com.orgs;

public class Nloop3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//
		// 5 4 3 2 1
		// 5 4 3 2 1
		
			
		for(int i=5;i>=4;i--)
		{
			for(int j=5;j>=1;j--)
			{
				System.out.print(j+" ");
			}
		  
		System.out.println();
			}
			}
		}

	


